import React from 'react';
import './index.css'

const Lists =(props) =>{
    
    return(
        <>
            <div className='list-style'>
                 <i className="fa-solid fa-xmark" onClick={()=>{
                     props.onSelect(()=>{
                        props.id
                     })
                 }}></i>
                 <li>{props.text}</li>
            </div>
        </>

    )
}
export default Lists
